import React from 'react'

function Jumbotron () {
  return (
    <div className="jumbotron jumbotron-fluid">
  <div className="container text-center">
    <h1 className="display-4 shadow-lg p-3 mb-5 bg-white rounded">MCU Clicky Game</h1>
    <p className="lead shadow-lg p-3 mb-5 bg-white rounded">Click on an image to earn points, but don't click on any more than once!</p>
  </div>
</div>
  )
}

export default Jumbotron
